import './App.css';
import categoryList from './fake-data/all-categories';
import productList from './fake-data/all-products';

function Header() {
  return <h1 className="header">Products</h1>;
}

function Categories() {
  return categoryList.map((categoryName) => <Category title={categoryName} />);
}

function Category({ title }) {
  return <span className="categories--item">{title}</span>;
}

function Products() {
  return productList.map((product) => (
    <ul>
      <product title/>
    </ul>
  ));
}

function Product() {
  return <li>{}</li>;
}

function App() {
  return (
    <div className="App">
      <Header />
      <Categories />
    </div>
  );
}

export default App;
